This is me in high school trying to get back to running after about 26 surgeries. I was only 16 years old. I had surgery on my head as you can see to put in a pressure monitor to see the levels in my head.

It's hard to run with a wire directly in your skull, IV in your arm, and wires sticking to your chest. But as a runner with Hydrocephalus I had to test my limits.

I was getting a lot of severe headaches and throwing up after running so my doctor wanted to trigger a headache to get a read on what's wrong. They could never figure out why so they placed two shunts. Not enough research.

I was a sophomore by then and my goal was to break 5 in the mile. If we are being honest I never got the chance cause I had to give it up for my health. But you bet I stole my brothers sub 5 hoodie for a race or two. (Scared a few runners until that gun went off)

The nurse you see was a physical therapist who I needed to maintain muscle and movement so I don't get too thin laying in bed from my long stay.

I never gave up running even when the odds were stacked against me at a young age. Living a normal life was hard but I never gave up on being a runner and that's why I recently joined a track club to prove I can still do it. 

I'll do a race, a half, a marathon and I will break 5 for the mile. So this is why I fight to find a cure for Hydrocephalus so one day someone like me doesn't need to have surgeries to get better. No need for invasive surgeries. They can step on the track and know they can break 5 for the mile easily just takes practice. 

If you want to learn more about Hydrocephalus just ask. 

Want to donate link is in my bio. 

Thanks again for reading.

